import React from 'react'

function ProductCard() {
  return (
    <div>
        <div className="card">
            <img src="" alt="" className="prodimg" />
            <h3 className="prodname">product name</h3>
            <p className="proddesc">product description</p>
            <div className='rating'>
                {
                    [1, 2, 3, 4, 5].map((star) => (
                        <span key={star} className="star">&#9733;</span>
                ))}
            </div>
            div.
        </div>
    </div>
  )
}

export default ProductCard
